import React from 'react';
import { Link } from '@reach/router';
import { Button } from 'semantic-ui-react';


const LandingPage = () => {

    return (
        <div className="wrapper">
            <header>
                <h1>Planthood </h1>
                <div className="button">
                <Button className="ui green basic button large"><Link style={{"color": "green"}} to={"/"}>Log In</Link></Button>
                <Button className="ui green basic button large"><Link to={"/"}>Sign Up</Link></Button>
                </div>
            </header>
            <div className="landingDisplay"></div>
        </div>
    )
}

export default LandingPage
